"use strict";exports.convertDateToTimestamp=e=>{let t=[],s=0;if(e.includes("-")&&(t=e.split("-")),e.includes("/")&&(t=e.split("/")),e.includes(" ")){let[i,p]=e.split(" "),n=p.split(":");e.includes("-")&&(t=i.split("-")),e.includes("/")&&(t=i.split("/")),s=new Date(parseInt(t[2]),parseInt(t[1])-1,parseInt(t[0]),parseInt(n[0]),parseInt(n[1])).getTime()}else s=new Date(parseInt(t[2]),parseInt(t[1])-1,parseInt(t[0])).getTime();return s/1e3},exports.isTimestampExpired=e=>Date.now()>e;
